import React, { useEffect, useState } from 'react';
import ReactDOM from 'react-dom';
import AllProducts from './components/AllPosts';




const App = () => {
    const [posts, setPosts] = useState([]);
    const [users, setUsers] = useState([]);
    const [isLoggedIn, setIsLoggedIn] = useState(false);
    const [currentUser, setCurrentUser] = useState({})

    useEffect(() => {
        const fetchPosts = async () => {
            try {
                const response = await fetch('https://strangers-things.herokuapp.com/api/2206-FTB-ET-WEB-FT-B/posts');
                const data = await response.json();
                setPosts(data.data.posts);
            } catch (error) {
                console.error(error);
            }
        };
        fetchPosts();
    }, [])

    return (
        <div>
            <p>Welcome to Stranger's Things</p>

            return (
            <div>
                <AllPosts posts={posts} setPosts={setPosts} />
            </div>
            )


        </div>
    )
}

const appElement = document.getElementById('app');

